import { Row, Col, Button } from 'antd';
import Link from 'next/link';


const Form = () => {
  return (
    <div>
	<Row>
	  <Col span={12} offset={6}>
		<p>This is the about page</p>
	  </Col>
	</Row>

      <ul>
	<li>
	      <Link href="/">
		<a>Home</a>
	      </Link>
	</li>
	<li>
	      <Link href="/about">
		<a>About</a>
	      </Link>
	</li>
      </ul>

      <Button type="primary">Button</Button>

    </div>
  );
};

export default Form;
